import { Fragment } from "react";
import {
  Radio,
  TodoLi,
  TodoText,
  DeleteBtn,
} from "../Style/ComponentStyle/TodoStyle";

export const Todo = () => {
  return (
    <Fragment>
      <TodoLi>
        <Radio type={"radio"} />
        <TodoText>테스트 텍스트입니다</TodoText>
        <DeleteBtn src="img/close_btn.svg" alt="닫기 버튼"></DeleteBtn>
      </TodoLi>
    </Fragment>
  );
};
